import React from 'react';
import { Box, Typography, Grid } from '@mui/material';

const LeagueGoals = ({ data }) => {
  const sortedLeagues = Object.entries(data).sort((a, b) => b[1] - a[1]);

  return (
    <Box sx={{ 
      height: '100%', 
      width: '100%', 
      display: 'flex', 
      flexDirection: 'column',
      border: '1px solid rgba(255, 255, 255, 0.1)',
      borderRadius: '10px',
      padding: '15px',
      backgroundColor: 'rgba(30, 144, 255, 0.1)',
    }}>
      <Typography variant="h5" gutterBottom style={{ color: '#1E90FF' }}>
        Goles por Liga
      </Typography>
      <Grid container spacing={1}>
        {sortedLeagues.slice(0, 10).map(([league, goals]) => (
          <Grid item xs={6} key={league}>
            <Typography variant="caption" style={{ color: '#1E90FF' }}>
              {league}
            </Typography>
            <Typography variant="body2" style={{ color: '#FFFFFF' }}>
              {goals}
            </Typography>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default LeagueGoals;
